from datetime import timedef get_start_time(curse:int, n:int):    if curse < 3:        match n:            case 1:                return time(8, 15)            case 2:                return time(9, 45)            case 3:                return time(11, 15)            case 4:                return time(13)            case 5:                return time(14, 30)            case _:                return None    elif 3 <= curse < 5:        match n:            case 1:                return time(13)            case 2:                return time(14, 30)            case 3:                return time(16)            case 4:                return time(17, 40)            case 5:                return time(19, 10)            case _:                return Nonedef get_end_time(curse:int, n:int):    if curse < 3:        match n:            case 1:                return time(9, 35)            case 2:                return time(11, 5)            case 3:                return time(12, 35)            case 4:                return time(14, 20)            case 5:                return time(15, 50)            case _:                return None    elif 3 <= curse < 5:        match n:            case 1:                return time(14, 20)            case 2:                return time(15, 50)            case 3:                return time(17, 20)            case 4:                return time(19 )            case 5:                return time(20, 30)            case _:                return None